import React, {useState} from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import {windowListener, burgerClick} from './scripts/myscripts.js';
import { useEffect } from 'react';
import $ from 'jquery';
import { SwitchContent } from './pages/login.js';


function Menu(props) {
  const [currentPage, setCurrentPage] = useState('login');
  const closeBurgerMenu = () => {
    
    $('#phoneBarMenu').css('height', '0');
  };

  useEffect(()=>{
    windowListener();
    burgerClick();
    
  });
  
  return (
    <div className='container-fluid'>
      <div className='row'>
        <div className='col-12 menuBar'>
          <div id="compBar">
            <Link to="./"><button className='menuBut'>Home</button></Link>
            <Link to="./profile"><button className='menuBut'>Profile</button></Link>
            <Link to="./login"><button className='menuBut'  onClick={() => SwitchContent('create', setCurrentPage)}>Create Account</button></Link>
            <Link to="./login"><button className='menuBut'  onClick={() => SwitchContent('login', setCurrentPage)}>Log In</button></Link>
          </div>
          <div id="phoneBar">
            <div id="burger" >
            <div className="patty"></div>
            <div className="patty"></div>
            <div className="patty"></div>
            </div>
            <div id="phoneBarMenu" className='d-flex flex-column align-items-center'>
              <Link to="./"><button className="menuBut pt-5" onClick={closeBurgerMenu}>Home</button></Link>
              <Link to="./profile"><button className="menuBut" onClick={closeBurgerMenu}>Profile</button></Link>
              <Link to="./login"><button className="menuBut" onClick={()=>{closeBurgerMenu(); SwitchContent('create');}}>Create Account</button></Link>
              <Link to="./login"><button className="menuBut pb-5" onClick={()=>{closeBurgerMenu(); SwitchContent('login');}}>Log In</button></Link>
            </div>
            </div>   
        </div>
        
      </div>
    </div>
  );
}

export default Menu;
